Πόσοι ψήφισαν;

Όχι πόσοι είναι μέλη, δηλαδή ~60Κ που ήταν ήδη, συν τα νέα. 

Ρωτάω πόσοι ψήφισαν. Ξέρουμε;

- Μία τετραετία ακόμη θα ζητήσει ο κ. Μητσοτάκης από τον ελληνικό λαό, για να καταφέρει να ολοκληρώσει το έργο του.
- Ποιό έργο;
- Την απογραφή του πληθυσμού.

